INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('465', 'IT', 'Hai interessanti notizie riguadanti il Geocaching?<br /> Qui puoi creare nuove notizie che verrano visualizzate in homepage.', '2010-10-27 18:49:19');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('466', 'IT', 'L\'attivazione del tuo utente ha avuto successo. Puoi ora autenticarti alla pagina di autenticazoine.<br /><br /> <a href=\"login.php\">Vai alla pagina di autenticazione</a>', '2010-09-01 23:48:28');
