INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('469', 'IT', 'I migliori saluti,<br/>il tuo team Opencaching', '2010-08-31 20:06:23');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('470', 'IT', 'Per favore abbi pazienza, faremo del nostro meglio per riportare nuovamente il sito in linea appena possibile.', '2010-09-01 23:48:28');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('471', 'IT', 'L\'utente non può essere creato, la ragione non è nota. Se non riesci a risolvere da solo il problema, per favore contattaci tramie <a href=\"mailto:%1\">email</a>.', '2010-08-31 20:06:23');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('472', 'IT', 'Noi rispettiamo la tua privacy. I tuoi dati personali verranno registrati nel nostro database e non saranno rivelati a terzi. Puoi prendere visione dei dettagli alla pagina <a href=\"articles.php?page=dsb\">privacy statement</a>. Se ha altre domande, per favore <a href=\"mailto:%1\">contattaci</a> <b>prima</b> di creare un utente.', '2010-09-01 23:48:28');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('473', 'IT', 'Dobbiamo approvare il tuo nuovo inserimento prima di visualizzarlo. Cercheremo di farlo tra 24 e 48 ore. Le notizie non possono essere modificate una volta che le hai inviate. Se vuoi eseguire delle modifiche, per favore inviale nuovamente. Puoi introdurre notizie riguardanti il Geocaching, ma non puoi fare pubblicità per prodotti o per geocaches. La decisione se approvare o meno una notizia è di esclusiva pertinenza dell\'operatore di questa pagina web - non sono possibili rivendicazioni per la pubblicazione. In caso di dubbio, per favore attendi se la tua notizia sarà pubblicata, o chiedi via email a <a href=\"mailto:%1\">%1</a> prima di inviarla.\r', '2010-08-31 20:06:23');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('474', 'IT', 'Se questo problema persiste per un tempo più lungo, per favore contattaci via email a <a href=\"mailto:%1\">%1</a>. ', '2010-09-01 23:48:28');
